import './index.css';
import App from './App';
import {BrowserRouter as Router} from 'react-router-dom'
import react from 'react';

react.render(
  <React.StrictMode>
  <Router>
    <App />
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);

